'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLook beneath the façade of affable confidence and seamless well-adjustment that today’s elite students have learned to project, and what you often find are toxic levels of fear, anxiety, and depression, of emptiness and aimlessness and isolation. We all know about the stressed-out, overpressured high school student; why do we assume that things get better once she gets to college?\n\nDecember 27, 2014\n\u001c15\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccent survey—summarized by the American Psychological Association under the headline “The Crisis on Campus”—nearly half of college students reported feelings of hopelessness, while almost a third spoke of feeling “so depressed that it was difficult to function during the past 12 months.” College counseling services are being overwhelmed.\n\nDecember 27, 2014\n\u001c15\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s important for us to take away the blinders that keep us from seeing their distress.”\n\nHow to ID kids who feel like they aren\u0027t doing what they know in their hearts they need to do.\n\nDecember 27, 2014\n\u001c19\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMainly, though, these kids are very good at hiding their problems from us\n\nDecember 27, 2014\n\u001c19\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe problem is that students have been taught that that is all that education is: doing your homework, getting the answers, acing the test. Nothing in their training has endowed them with the sense that something larger is at stake. They’ve learned to “be a student,” not to use their minds. I was talking with someone who teaches at a branch campus of a state university. His students don’t think for themselves, he complained. Well, I said, Yale students think for themselves, but only because they know we want them to. I taught many wonderful young people during my years in the Ivy League—bright, thoughtful, creative kids whom it was a pleasure to talk with and learn from. But most of them seemed content to color within the lines that their education had marked out for them. Very few were passionate about ideas.\n\nDecember 27, 2014\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA friend who taught at Amherst mentioned a student who came to her for extra help with his writing—but only because he had already been admitted to medical school and now felt free to actually learn. If he were a freshman or sophomore, he said, he wouldn’t have taken the time.\n\nDecember 27, 2014\n\u001c21\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStudents simply don’t have time for that kind of headlong immersion. The frenzy of extracurricular activities has expanded to fill the available space, displacing intellectual pursuits as the focus of student energy. David Brooks and other observers have spoken about the death of the late-night bull session, the scarcity of spontaneous intellectual discussion. I’ve heard similar complaints from students at Brown, Penn, Cornell, Pomona, and Columbia. “I’ve never been able to justify to myself why I feel so much ‘smarter’—more productive, more creative, more interesting (and more importantly, more interest ed )—during the summers than I ever do during the school year,” a Princeton senior wrote me.\n\nDecember 28, 2014\n\u001c21\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNow the magic terms are GPA, Phi Beta Kappa, Fulbright, MCAT, Harvard Law, Goldman Sachs. They signify not just your fate, but your identity; not just your identity, but your value. They are who you are, and what you’re worth\n\nDecember 27, 2014\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDouthat describes in Privilege, a memoir of his time at Harvard, where all that intellect is put to the service, not of learning as much as possible, but of getting away with doing as little as you can.\n\nDecember 27, 2014\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn high school, everybody had the same objective, to get into the most prestigious college possible, and the hoops were all lined up to lead you there. But once you get to college, things are not so certain anymore. Directions multiply, and many of the paths are foggy. As Keegan suggested, being a musician does not have an application form. How do you become a social entrepreneur, a politician, a screenwriter? How do you get to work at the State Department, in Silicon Valley, for the New York Times ? How many options are there that you haven’t even heard of, and how does getting a job work, anyway? It isn’t any wonder, as graduation draws near, that a lot of students scurry frantically around, looking for another hoop to jump through.\n\nDecember 27, 2014\n\u001c25\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"19ZGQmgoc7lasqhap5HEwffdWF59PwF9XuHxmQpI","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1eb0y21JfFxb76FO_s9L