i":4706,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":4707,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy friends and I didn’t run sprinting down a thousand career paths, bound for all corners of the globe,” he wrote. “Instead, we moved cautiously, in groups, plodding down a few well-worn trails so as to ensure that two or four years down the road, we could be stem cells again, still undifferentiated, still brimming with potential.”\n\nDecember 27, 2014\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI think consulting in particular appeals to this perverse fantasy that most Ivy Leaguers harbor deep down inside, which is that someone should pay them for simply having gone to Yale or Harvard or wherever. All of the various reasons I’ve been given by my peers to explain why they’re consulting next year boil down to the same thing: “because I can.” Few people have the balls to walk away from that.\n\nDecember 27, 2014\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt is true that today’s young people appear to be more socially engaged, as a whole, than kids have been for several decades: more concerned about the state of the world and more interested in trying to do something about it. It is true, as well, that they are more apt to harbor creative or entrepreneurial impulses. But it is also true, at least at the most selective schools, that even if those aspirations make it out of college—a very big “if”—they tend to be played out within the same narrow conception of what constitutes a valid life: affluence, credentials, and prestige.\n\nDecember 27, 2014\n\u001c27\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe key word there is “safety.” Beneath the other factors—the entitlement, the lack of direction, the desire not to close down options—the force that drives the salmon run is fear. It is the exact fear (and more than fear: the panic, the often crippling anxiety) that lies behind that façade of serene achievement that elite college students learn to show the world. So extreme are the admission standards now, so ferocious the competition, that kids who manage to get into elite colleges have, by definition, never experienced anything but success. The prospect of not being successful terrifies them, disorients them, defeats them\n\nDecember 27, 2014\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cnobody wants to take a chance on a class they might not ace, so nobody is willing to venture beyond the things they already know and do very well. Experimenting, exploring, discovering new ways to look at the world as well as new capacities within yourself—the things a college education is supposed to be about—fall by the wayside.\n\nDecember 27, 2014\n\u001c29\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI have seen students stumble for years, as many bright young people do today, unwilling to submit to doing something that they can’t feel passionate about but still not knowing where their passion really lies. One spoke of continuing to struggle not only with anxiety and fear, but also with ambition: not, that is, with a genuine desire for excellence, but with the feeling of being a failure if you don’t continue to amass the blue-chip names, the need to keep on doing the most prestigious possible thing—and the constant awareness, over your shoulder, of all the prestigious things that your former classmates are doing.\n\nDecember 27, 2014\n\u001c30\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m at medical school here in Canada and your sentiments apply beyond the Ivy League.” “We have our own Ivy League in India,” said another. “We call them Indian Institutes of Technology (IIT) and Indian Institutes of Management (IIM). Every single thing you mentioned I have witnessed happening in practice.”\n\nDecember 27, 2014\n\u001c31\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSome say they ended up in their profession because of someone else’s expectations, or that they simply drifted into it without pausing to think whether they really loved their work. Often they say they missed their youth entirely, never living in the present, always pursuing some ill-defined goal.\n\nDecember 27, 2014\n\u001c31\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001calways for the opportunities it opens up. But what of all the opportunities it closes down—not for any practical reason, but just because of how it smothers you with expectations? How can I become a teacher, or a minister, or a carpenter? Wouldn’t that be a waste of my fancy education? What would my parents think? What would my friends think? How would I face my classmates at our twentieth reunion, when they’re all rich doctors or important people in New York? And the question that exists behind them all: isn’t it beneath me? So an entire world of possibilities shuts, and you miss your true calling.\n\nDecember 27, 2014\n\u001c32\n\u0011\n\u0011"},{"ty":"te","id":"i.11","spi":4716},{"ty":"te","id":"i.12","spi":5088},{"ty":"te","id":"i.13","spi":5528},{"ty":"te","id":"i.14","spi":6148},{"ty":"te","id":"i.15","spi":6819},{"ty":"te","id":"i.16","spi":7190},{"ty":"te","id":"i.17","spi":7853},{"ty":"te","id":"i.18","spi":8200},{"ty":"te","id":"i.19","spi":8537},{"ty":"as","st":"par