65,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8166,"ei":8184,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8203,"ei":8502,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8503,"ei":8521,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8540,"ei":9147,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":9148,"ei":9166,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":9173,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA whole new set of admissions criteria was developed to hold back the Semitic tide by making sure that the\n\nDecember 27, 2014\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cright sort” of student got in: letters of recommendation, alumni interviews, the preference for athletes and “leaders,” special treatment for sons of alumni (that is, “legacies”), an emphasis on geographic distribution, and a devaluation of pure academic ability. Better midwestern Protestants, even if they weren’t all the sharpest tools in the shed, than “greasy grinds” from Brooklyn. Princeton started requiring applicants to submit a photo, since you couldn’t always tell from the name. “Character” became the explicit ideal: manners, looks, tone, being a “Yale man”—all once guaranteed by where you went to school, now enforced through a subjective process of evaluation (and the admissions offices that had to be created to conduct it).\n\nDecember 27, 2014\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApplicants, each represented by a long string of figures and codes (SATs, GPA, class rank, numerical scores to which the letters of recommendation had been converted, special notations for athletes, legacies, diversity cases, and so forth), had been assigned a single cumulative score from 1 to 4.\n\nDecember 27, 2014\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn six hours of committee work, we disposed of somewhere between 100 and 125 cases, or about three or four minutes per applicant, looking for 10–15 admissions to fill out the rough allotment of approximately 40 for the region.\n\nDecember 27, 2014\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe resume arms race,” as it is invariably called, is just like the nuclear one. The only point of having more is having more than everybody else. Nobody needed 20,000 atomic warheads until the other side had 19,000. Nobody needs eleven extracurriculars, either—what purpose does having them actually serve?—unless the other guy has ten.\n\nDecember 27, 2014\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy office,” Levine writes, “has seen an endless stream of bright, talented children who are disinterested in school because ‘My parents think there are only two things to be in the world: a doctor or a lawyer.’ ” A Stanford student told me that his parents let him know that if he switched from engineering to humanities, they’d cease to pay his tuition. A recent Yale graduate who is pursuing a teaching career despite parental opposition wrote about “a mother bent on ‘opening doors for me’ and pushing me into an elite that she eyed with desire from the middle class. She wanted me to have everything instead of wanting me to have what I wanted.”\n\nDecember 27, 2014\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cParents of high achievers are often oblivious, even willfully so, to what their kids are going through. Levine cites a raft of troubling statistics: “Preteens and teens from affluent, well-educated families . . . experience among the highest rates of depression, substance abuse, anxiety disorders, somatic complaints, and unhappiness of any group of children in this country.” “As many as 22 percent of adolescent girls from financially comfortable families suffer from clinical depression.\n\nDecember 27, 2014\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPerhaps most disturbing of all, affluent teenagers feel less connected to their parents than do any other group of teens, including poor ones. Praise, Levine says, is not warmth, and the vaunted self-esteem that parents are so keen to instill is not the same as self-efficacy, the belief in your ability to get things done in the world. Hovering and criticism, adds William Damon, author of The Path to Purpose and many other books on child development, should not be confused with attention or guidance. High-pressure parents, as one of Levine’s young patients puts it, are “everywhere and nowhere at the same time.” They are intrusive, but they are not connected.\n\nDecember 27, 2014\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy sense, as I have spoken with teachers at elite high schools, is that most understand what is wrong and wish they could do better by their students.\n\nDecember 27, 2014\n\u001c53\n\u0011\n\u0011"},{"ty":"te","id":"i.20","spi":9182},{"ty":"te","id":"i.21","spi":9327},{"ty":"te","id":"i.22","spi":10109},{"ty":"te","id":"i.23","spi":10445},{"ty":"te","id":"i.24","spi":10710},{"ty":"te","id":"i.25","spi":11086},{"ty":"te","id":"i.26","spi":11774},{"ty":"te","id":"i.27","spi":12304},{"ty":"te","id":"i.28","spi":13008},{"ty":"as","st":"paragraph","si":9173,"ei":9173,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":9174,"ei":9174,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":9175,"ei":9175,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":9177,"ei":9177,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":9179,"ei":9179,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":9181,"ei":9181,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":91