","st":"text","si":13163,"ei":13181,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":13188,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSome have described the ways they try to smuggle different values into the classroom, like love of learning or service to the community. The problem is they don’t have any room to operate. One teacher at a prep school in Westchester told me of a student breaking down in tears during a discussion of Catcher in the Rye . He didn’t want to have to be a stockbroker, like his parents said. That very night, she got a call from the boy’s mother: “Don’t put any ideas into his head.”\n\nDecember 27, 2014\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA series that was published in a Palo Alto paper—Palo Alto, of all places—portrays an environment at the local high schools that is “hostile to learning.” The kids in “Doing School” rarely hear that education might be valuable for its own sake. “I went to Hopkins, a Yale feeder school, and hated it,” a former student wrote me. “The place turned learning into a simple endurance test, blithely awarding the best ‘athletes.’ ”\n\nDecember 27, 2014\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe drug no longer gives them pleasure; it only takes away the pain—the pain, that is, of needing the drug. So it is with the drug of praise upon which these children are trained to depend: the praise that is the sign of parental love, for the achievement that is the condition of that love. Every A is a fix that temporarily quells the anxiety of failure, the terror of falling short\n\nDecember 27, 2014\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAll achievement becomes a stand-in for parental approval. “He seeks insatiably for admiration,” Miller writes, “of which he never gets enough because admiration is not the same thing as love.”\n\nDecember 27, 2014\n\u001c57\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd so, Miller says, the gifted child—no longer necessarily a child, needless to say—swings incessantly between the poles of grandiosity and depression. Grandiosity is the delusion of supremacy. It’s what your parents told you when you did live up to their expectations: You’re perfect! You’re the best! You can do anything you want! It is self-esteem at its most distended, that rush you get when you ace your SATs or get the job at Goldman.\n\nDecember 27, 2014\n\u001c57\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDepression is the state that ensues when you suffer a setback, and the delusion collapses. Depression means self-loathing, self-disgust, and the kind of emotional numbness that feels like psychic death. It also means self-punishment, which, among other things, is all those thoughts you use to make yourself feel bad—“I’m not good enough,” “I’m not smart enough,” “I don’t work hard enough,” “So-and-so is better than me,” etc., etc.—and which stems from the feeling that you don’t deserve to be happy. “If I didn’t take Zoloft,” a former student told me, “I would hate myself.” Grandiosity involves contempt for others; depression involves contempt for yourself\n\nDecember 27, 2014\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEven getting a job at Yale turned out to be, like every achievement, no more than a temporary salve. Within a few months, he was asking me when I was going to get my dissertation published. But he wasn’t the real problem anymore, and his death, a decade later, made very little difference. The real problem was, as one of my students has put it, “the Frankenstein’s monster of ambition,” the insatiable need to be “the best.”\n\nDecember 27, 2014\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI was missing my life. I was missing my chance to be happy, missing my chance to be free. I was also missing something else: the joy that comes when you stop feeling threatened by other people’s accomplishments and let yourself be open to the beauty that they bring\n\nDecember 27, 2014\n\u001c60\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSatan, who is not a beastlike creature in the poem, but the brightest of the angels, the first in his class, fallen, precisely, from excess ambition. He has arrived in Eden to destroy the happiness of Adam and Eve, and looking around himself, he thinks: the more I see Pleasures about me, so much more I feel Torment within me, as from the hateful siege Of contraries; all good to me becomes Bane, and in Heav’n much worse would be my state. That’s how envy works: the better things are, the worse they are, because they don’t belong to you.\n\nDecember 27, 2014\n\u001c60\n\u0011\n\u0011"},{"ty":"te","id":"i.29","spi":13197},{"ty":"te","id":"i.30","spi":13715},{"ty":"te","id":"i.31","spi":14180},{"ty":"te","id":"i.32","spi":14603},{"ty":"te","id":"i.33","spi":14834},{"ty":"te","id":"i.34","spi":15315},{"ty":"te","id":"i.35","spi":16016},{"ty":"te","id":"i.36","spi":16480},{"ty":"te","id":"i.37","spi":16784},{"ty":"as","st":"paragraph","si":13188,"ei":13188,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as