tional role for college students”: to help them figure out who they are and what their purpose in the world should be. Schools, in fact, “are having a hard time making the case that the education they offer is about anything in particular”—or as he puts it more bluntly, “Harvard no longer knows what a good education is.”\n\nMaybe doing this launch summit stand-alone isn\u0027t such a bad idea. And hawaii alone too. Those passionate can continue. Chunk it is not bad. Can\u0027t force these long term projects. People join biz Japan because its cool and trendy. We want them to join with a greater sense of purpose.\n\nDecember 28, 2014\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere is no vision,” writes Allan Bloom, “nor is there a set of competing visions, of what an educated human being is.”\n\nDecember 28, 2014\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe suckage factor is a measure of how badly you suck at everything because you’re trying to do too much\n\nDecember 28, 2014\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAcademic “units” (that is, departments) are seen as “revenue centers”; the ones that can’t pull their weight—much of the liberal arts—are slated for downsizing or outright elimination. Science is king, but not just any science; basic research is suffering, too. The holy grail is technology transfer: scientific investigation, often sponsored directly by corporations, that is capable of being parlayed into profit.\n\nDecember 28, 2014\n\u001c72\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNew buildings, new research centers, new campuses around the world. NYU in Abu Dhabi, Yale in Singapore, Columbia in China, Turkey, Brazil: the point is to build the brand, capture market share, and tap the emerging sources of global wealth.\n\nDecember 28, 2014\n\u001c72\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe customer-service mentality is also responsible for the profusion of swanky new dorms, gyms, and student centers—a building boom that, like the other ones that happened in the 1990s and early 2000s, was financed by a mountain of debt, and that has been a major factor in tuition growth.\n\nDecember 28, 2014\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cColleges now sell themselves to kids in terms of what they can give them, not what they plan to expect of them. “With no larger educational ideals to shape the undergraduate experience,” Lewis says, “decisions affecting students are calculated to satisfy their immediate demands.” Instead of humanities, students are getting amenities.\n\nDecember 28, 2014\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo get an education, you’re probably going to have to fight against the institution that you find yourself in—no matter how prestigious it may be. (In fact, the more prestigious the school, the more you’ll probably have to push.)”\n\nGrow is gonna need to be a little more active. Ask users to consider identity purpose values growth interests courage. Not just to attain job. Current version is quite passive - like u r already doing the right things, they just aren\u0027t being measured.\n\nDecember 28, 2014\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI was often approached, during my years at Yale, by just that kind of kid: ardent, curious, independent—looking to college for meaning, not skills; looking to the world for possibility, not security. What they told me, invariably, was that they felt abandoned by their institution, that the education they were being offered had nothing to say to them and that they had no one to help them figure out how to live a life commensurate with their aspirations. These are the students that colleges should prize most highly, yet they are the ones that they’re failing most badly.\n\nPT should offer something other institutions don\u0027t. I think a chapter of this book might help.\n\nDecember 28, 2014\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001celite schools have strong incentives not to produce too many seekers and thinkers, too many poets, teachers, ministers, public-interest lawyers, nonprofit workers, or even professors—too much selflessness, creativity, intellectuality, or idealism. T\n\nJust ask Hiro with hitotsubashi.\n\nDecember 28, 2014\n\u001c75\n\u0011\n\u0011"},{"ty":"te","id":"i.38","spi":17364},{"ty":"te","id":"i.39","spi":18105},{"ty":"te","id":"i.40","spi":18263},{"ty":"te","id":"i.41","spi":18406},{"ty":"te","id":"i.42","spi":18860},{"ty":"te","id":"i.43","spi":19140},{"ty":"te","id":"i.44","spi":19468},{"ty":"te","id":"i.45","spi":19842},{"ty":"te","id":"i.46","spi":20364},{"ty":"te","id":"i.47","spi":21073},{"ty":"as","st":"paragraph","si":17355,"ei":17355,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":17356,"ei":17356,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":17357,"ei":17357,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":17359,"ei":17359,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":17361,"ei":17361,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":17363,"ei":17363,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell