m":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21039,"ei":21057,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21076,"ei":21326,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21327,"ei":21360,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21361,"ei":21379,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":21386,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 28, 2014\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe romance of college remains: the dream, as Bloom puts it, of having an adventure with yourself.\n\nWhat if we made a pre or post college 3, 6 or 9 month college program. Learn whatever. Have that adventure thru books, movies, research, meetups, etc.\n\nDecember 28, 2014\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBeneath the cynicism that students feel they are forced to adopt, beneath their pose of placid competence, the longings of youth remain. There is an intense hunger among today’s students, my travels in the last few years have shown me, for what college ought to be providing but is not: for a larger sense of purpose and direction; for an experience at school that speaks to them as human beings, not bundles of aptitudes; for guidance in addressing the important questions of life;\n\nDecember 28, 2014\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfor simple permission to think about these things and a vocabulary with which to do so. It is to the ways that they can start to satisfy that hunger that I now turn.\n\nDecember 28, 2014\n\u001c77\n\u0011\n\u0011\n\n\nPart 2. Self\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn 1971, 73 percent of incoming freshmen said that it is essential or very important to “develop a meaningful philosophy of life,” 37 percent to be “very well-off financially” (not well-off, note, but very well-off). By 2011, the numbers were almost reversed, 47 percent and 80 percent, respectively. For well over thirty years, we’ve been loudly announcing that happiness is money, with a side order of fame. No wonder students have come to believe that college is all about getting a job\n\nDecember 29, 2014\n\u001c80\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdeveloping the habit of skepticism and the capacity to put it into practice. It means learning not to take things for granted, so you can reach your own conclusions.\n\nDecember 29, 2014\n\u001c81\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSociety is a conspiracy to keep itself from the truth. We pass our lives submerged in propaganda: advertising messages; political rhetoric; the journalistic affirmation of the status quo; the platitudes of popular culture; the axioms of party, sect, and class; the bromides we exchange every day\n\nDecember 30, 2014\n\u001c81\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe first purpose of a real education (a “liberal arts” education) is to liberate us from doxa by teaching us to recognize it, to question it, and to think our way around it.\n\nDecember 30, 2014\n\u001c82\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe point was not to replace his students’ opinions with his own. The point was to bring his charges into the unfamiliar, uncomfortable, and endlessly fertile condition of doubt\n\nDecember 30, 2014\n\u001c82\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCollege, after all, as those who like to denigrate it often say, is “not the real world.” But that is precisely its strength. College is an opportunity to stand outside the world for a few years, between the orthodoxy of your family and the exigencies of career, and contemplate things from a distance. It offer students “the precious chance,” as Andrew Delbanco has put it, “to think and reflect before life engulfs them.” You can start to learn to think in high school, as Edmundson did—you’re certainly old enough by then—but your parents are still breathing down your neck, and your teachers are still teaching to the test, in one respect or another. College should be different: an interval of freedom at the start of adulthood, a pause before it all begins.\n\nWhy should college be the only time for such exploration?\n\nDecember 30, 2014\n\u001c82\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA professor’s most important role is to make you think with rigor: precisely, patiently, responsibly, remorselessly, and not only about your “deepest ingrained presuppositions,” as my own mentor, Karl Kroeber, once wrote, but also about your “most exhilarating new insights, most of which turn out to be fallacious.” You want some people in your life whose job it is to tell you when you’re wrong.\n\nDecember 30, 2014\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe classroom is the grain of sand; it’s up to you to make the pearl.\n\nDecember 30, 2014\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCollege is not the only chance to learn to think. It is not the first; it is not the last; but it is the best. One thing is certain: if you haven’t started by the time you finish your BA, there’s little likelihood you’ll do it later.\n\nDecember 30, 2014\n\u001c83\n\u0011\n\u0011"},{"ty":"te","id":"i.48","spi":21395},{"ty":"te","id":"i.49","spi":21432},{"ty":"te","id":"i.50","spi":21721},{"ty":"te","id":"i.51","spi":22242},{"ty":"te","id":"i.52","spi":22461},{"ty":"te","id":"i.53","spi":22989},{"ty":"te","id":"i.54","spi":23193},{"ty":"te","id":"i.55","spi":23527},{"ty":"te","id":"i.56","spi":23740},{"ty":"te","id":"i.57","spi":23956},{"ty":"te","id":"i.58","spi":24817},{"ty":"te","id":"i.59","spi":25253},{"ty":"te","id":"i.60","spi":25361},{"ty":"as","st":"paragraph","si":21386,"ei":21386,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":21387,"ei":21387,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":21388,"ei":21388,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":21390,"ei":21390,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":21392,"ei":21392,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":21