Nl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":25624,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou’re here to build a self.” Whether this activity redounds to anybody else’s benefit is, for the time being, beside the point. A self is something that you need to develop for your own sake, and it is not a quick or easy or even, often, a pleasant process.\n\nDecember 30, 2014\n\u001c84\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOf all the beliefs we absorb before we’re old enough to question them, the most powerful, as well as the most personal, are those that tell us who we are—that seek to determine our identity and our values. College is the place to start to determine them for yourself, to figure out, as the Columbia historian Mark Lilla has put it, “just what it is that’s worth wanting.” To find out not just who you wish to be, but who you are already, underneath what everyone has wanted you to think about yourself. To discover new ideals and new desires.\n\nDecember 30, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat you should really want to develop in college is the habit of reflection, which means the capacity for change.\n\nDecember 30, 2014\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe might propose, then, that you should arrive at college as at the beginning of a pilgrimage—a movement toward the truth and toward the self. That you should come to seek conversion, though you know not yet to what belief or way. That you should approach ideas as instruments of salvation, driven by a need to work things through for yourself, so that you won’t be damned to go through life at second hand, thinking other people’s thoughts and dreaming other people’s dreams. It’s been said that people go to monasteries to find out why they have come, and college ought to be the same.\n\nDecember 30, 2014\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ceducation, like a true religion, enables you to stand apart, and if necessary, against, the claims that others make upon you. The self is a separate space, a private space—exactly that inner space that Madeline Levine has found to be lacking in so many of her adolescent patients now. It is a space of strength, security, autonomy, creativity, play. You can live without a soul, D. H. Lawrence said, on ego and will alone—you can “go on, keep on, and rush on”—but you won’t have very much inside you. People who behave like that, E. M. Forster has a character remark, are incapable of saying I . They cannot even say I want, “because ‘I want’ must lead to the question ‘Who am I?’ ” So they only say want, without the I : “want money,” “want mansion,” “want Harvard\n\nDecember 30, 2014\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe purpose of college, to put all this another way, is to turn adolescents into adults. You needn’t go to school for that, but if you’re going to be there anyway, then that’s the most important thing to get accomplished. That is the true education: accept no substitutes.\n\nDecember 30, 2014\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd if you find yourself to be the same person at the end of college as you were at the beginning—the same beliefs, the same values, the same desires, the same goals for the same reasons—then you did it wrong. Go back and do it again.\n\nDecember 30, 2014\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou can’t be happy if you don’t know what you’re working for. Self-knowledge is the most practical thing in the world, because it helps you find your way to a career that’s right for you\n\nDecember 30, 2014\n\u001c90\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“What is the meaning of life?” may be the stereotypical philosophical question, supposedly abstract and pointless, but it bares its teeth when you phrase it like this: “What is the meaning of my life?” That is not a question that you want to wake up asking when you’re forty\n\nDecember 30, 2014\n\u001c90\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cVocation is Latin for calling: it means the thing you’re called to do. It isn’t something that you choose, in other words; it chooses you. It is the thing you can’t not do. It makes more sense to you than you do—makes more sense of you. But the summons doesn’t happen by itself. You have to do the work to make yourself receptive to it. To find yourself, you first must free yourself. You won’t be able to recognize the things you really care about until you have released your grip on all the things that you’ve been taught to care about.\n\nDecember 30, 2014\n\u001c90\n\u0011\n\u0011"},{"ty":"te","id":"i.61","spi":25633},{"ty":"te","id":"i.62","spi":25930},{"ty":"te","id":"i.63","spi":26511},{"ty":"te","id":"i.64","spi":26664},{"ty":"te","id":"i.65","spi":27290},{"ty":"te","id":"i.66","spi":28094},{"ty":"te","id":"i.67","spi":28405},{"ty":"te","id":"i.68","spi":28678},{"ty":"te","id":"i.69","spi":28903},{"ty":"te","id":"i.70","spi":29216},{"ty":"as","st":"paragraph","si":25624,"ei":25624,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":25625,"ei":25625,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":25626,"ei":25626,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":25628,"ei":25628,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.