alse,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29182,"ei":29200,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":29219,"ei":29759,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29760,"ei":29778,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":29785,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can invent a device or a drug or an app, but you can also invent your life. Instead of following a path, you can make your own path. There is artistic imagination, and scientific imagination, but there is also such a thing as moral imagination—“moral” meaning, not right or wrong per se, but having to do with the making of choices in the broadest sense. Moral imagination means the capacity to envision new alternatives for how to live.\n\nDecember 30, 2014\n\u001c91\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMoral imagination is hard, and it is hard in a completely different way than the hard things that elite students are used to doing. You can’t study for it. You can’t compete for it. The qualities it calls upon are those of character, not intellect. It’s never easy, and not only that, it’s never enough. You also need courage, moral courage, the bravery to act on your imagination in the face of what your family and friends are going to say to try to stop you. Because they’re not going to like it. The morally courageous person tends to make the individuals around him very uncomfortable. He doesn’t fit with their ideas about the way the world is supposed to work, and he makes them insecure about the choices they themselves have made—or failed to make. P\n\nDecember 30, 2014\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDorothea is her hero, her great soul—the one person, of all the many figures in this teeming epic, who possesses both the imagination to conceive a different life and the courage to attempt to live it. So when she gets a second chance, a second choice, she doesn’t play it any safer.\n\nDecember 30, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow will you live?” she asks, as relatives always do. “You will go away among queer people. And I shall never see you. . . . And you will be so poor.” Though Dorothea finally gets the life she wants, Eliot does not allow us to believe that it arrives without a cost. Middlemarch is indeed a novel for grown-up people.\n\nDecember 30, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s no surprise that when she came to write her masterpiece, she built it from these very themes: self and society, choice and consequence, cowardice and courage and convention and rebellion. Dorothea is not the novel’s only character who means to “shape their own deeds and alter the world a little.” The second-most important figure is a gifted young doctor named Lydgate, who plans to make a name in science. But Lydgate gets married too soon, to a vain and shallow beauty who insists on being pampered, and finally comes instead “to be shapen after the average”—an outwardly successful man who regards himself as a failure. For him, there is no happy ending. Lydgate has the imagination but lacks the courage, is finally too addicted to comfort and approval.\n\nDecember 30, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cin A Portrait of the Artist as a Young Man, James Joyce made use of a similar metaphor. “When the soul of a man is born in this country,” the protagonist Stephen Dedalus says about Ireland, “ there are nets flung at it to hold it back from flight. You talk to me of nationality, language, religion. I shall try to fly by those nets.”\n\nDecember 30, 2014\n\u001c95\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe like to think of ourselves as a wealthy country, but it is one of the great testaments to the intellectual—and moral, and spiritual—poverty of American society that it makes its most intelligent young people feel that they are being self-indulgent if they pursue their curiosity\n\nDecember 30, 2014\n\u001c95\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001clip service to the notion of “making a difference” or “giving back,” but altruism isn’t given much support unless it is pursued prestigiously, and if possible, lucratively. Students are expected to demonstrate creativity and perform service in order to get into college, but no one thinks they should be dumb enough to take them seriously as vocational goals. Along with “self-indulgent” comes “sitting under a tree and writing poetry,” an oddly specific stereotype that suggests that creative or intellectual work is invariably dreamy, solipsistic, irrelevant, useless, and maybe vaguely feminine and adolescent—as well as insisting, of course, that it isn’t really work at al\n\nDecember 30, 2014\n\u001c96\n\u0011\n\u0011"},{"ty":"te","id":"i.71","spi":29794},{"ty":"te","id":"i.72","spi":30274},{"ty":"te","id":"i.73","spi":31072},{"ty":"te","id":"i.74","spi":31394},{"ty":"te","id":"i.75","spi