oader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":33951,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDo for work what you do spontaneously—or did spontaneously, back when you were younger, before all the spontaneity got beaten out of you. Do what you would choose to do anyway, even if you didn’t get rewarded for it. Do the thing that you can immerse yourself inside for hours at a time. You know the thing you wish you could do, instead of what you’re doing now? Just do that thing. D\n\nDecember 30, 2014\n\u001c97\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhat you love to do the most: no, not that —not what you think you love, or think you ought to love, but what you really do love. There is by now a robust literature on the nature of happiness, and it converges on a pair of observations. Beyond a moderate level of material comfort, happiness consists of two things: feeling connected to others and engaging in meaningful work. These are hardly new ideas. Aristotle, who said that man is a social animal, also said that happiness derives from exercising one’s particular capacities. Doing strenuously, in other words, what you do well. Summoning that sense of joy and freedom that arises from your belly when you’re doing work that calls upon your favorite power\n\nDecember 30, 2014\n\u001c98\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGeorge Orwell wrote, “I knew that when I grew up I should be a writer. Between the ages of about seventeen and twenty-four I tried to abandon this idea, but I did so with the consciousness that I was outraging my true nature.” You don’t want to outrage your true nature.\n\nDecember 30, 2014\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Top Five Regrets of the Dying, a nurse who works in end-of-life care reports that the single most common regret her patients express is that “I wish I’d had the courage to live a life true to myself, not the life others expected of me.” You can endlessly delay gratification, doing work you hate because of the promise of future reward, or you can find your way to work that is its own reward\n\nDecember 30, 2014\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPurpose,” William Damon says, has the virtue of uniting the inner with the outer, the\n\nDecember 30, 2014\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cself with the world: what you want to do with what you see as needing to be done. “What moves you?” Galinsky likes to ask. “What do you feel connected to?” Becoming a lawyer isn’t a purpose. Becoming a lawyer to defend the rights of workers, or to prosecute criminals, is. Purpose means doing something, not “being” something\n\nDecember 30, 2014\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cShe knew that business school could be as narrowly directed an experience as college, but now she was ready to be proactive about finding a nontraditional path. Looking back, she wishes she had majored in something more interesting instead of defaulting to economics. “College is not about getting a job,” she had discovered, “it’s about getting an education.” But the whole process as it currently exists, she added, does not allow you to be “inward-turning”—“to think about what you really want instead of what you think you want.”\n\nDecember 30, 2014\n\u001c103\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd so I’ve done some soul-searching to really think about the kinds of “smart” I’d like to be, and the kinds of skills I really have (and don’t just pretend to have).\n\nDecember 30, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut together with another disillusioned Ivy League graduate (Cornell ’11), we’re going to try it. And in the process of working out the kinks, we’re realizing all the things a $55,000/year education didn’t teach us—like how the hell you properly prime a wall, or build a wooden table from cheap wood, or balance a restaurant budget. And if we fail epically, at least we had the “moral courage” to give it a shot.\n\nDecember 30, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBetween the major, which was more like a major and a half, and Columbia’s core curriculum and other requirements, I had locked up three-quarters of my courses for the next four years, and I hadn’t even gone to a single class. There was no one there to stop and make me think, no one there to save me from myself. My freshman composition teacher, whose class I loved and who might have provided a modicum of mentorship, did not bother to suggest that I ought to consider pursuing my passion for language. I don’t know when exactly things began to go wrong with my chosen course of study, or why\n\nDecember 30, 2014\n\u001c106\n\u0011\n\u0011"},{"ty":"te","id":"i.79","spi":33960},{"ty":"te","id":"i.80","spi":34384},{"ty":"te","id":"i.81","spi":35135},{"ty":"te","id":"i.82","spi":35444},{"ty":"te","id":"i.83","spi":35879},{"ty":"te","id":"i.84","spi":36003},{"ty":"te","id":"i.85","spi":36367},{"ty":"te","id":"i.86","spi":36940},{"ty":"te","id":"i.87","spi":37147},{"ty":"te","id":"i.88","spi":37599},{"ty":"as","st":"paragraph","si":33951,"ei":33951,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":33952,"ei":33952,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,