,"ei":37130,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":37150,"ei":37563,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":37564,"ei":37582,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":37602,"ei":38196,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":38197,"ei":38215,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":38223,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFail better,” Samuel Beckett famously wrote. If your standards are as high as they should be, you will fail again and again. That is the difference between mere success—getting the A, measuring up to some generic benchmark that may not actually be very high at all—and true excellence.\n\nDecember 30, 2014\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCromwell: “A man never rises so high as when he knows not whither he is going.\n\nDecember 30, 2014\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou may never completely eradicate the need for status, but you do not have to act on it. And the more that you resist it, the weaker it becomes.\n\nDecember 30, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Everything undertaken for its own sake is worthwhile,” the writer Geoff Dyer has put it, “irrespective of the outcome.” A\n\nDecember 30, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can’t accessorize your way to moral courage.\n\nDecember 30, 2014\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHere’s a rule of thumb: if you aren’t giving anything up, it isn’t moral and it isn’t courage. Stumbles, sacrifices, inner struggle, false starts and wrong turns, conflict with parents and peers—these are some of the signs of the genuine article.\n\nDecember 30, 2014\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDo it—invent your life, in whatever form that ends up taking, which need not be very cool or glamorous or countercultural at all—for your own sake alone.\n\nDecember 30, 2014\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd then there is the ever-worsening problem of student debt. It’s a lot more difficult to put aside vocational\n\nDecember 30, 2014\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cconsiderations and think of college as an opportunity for personal development when you know you’re going to graduate with tens of thousands of dollars in loans. As one professor said to me, a family’s relationship to college is going to be very different when the price is fifty thousand dollars a year than it was when it was five thousand dollars a year. If people are more apt to talk about higher education in terms of return on investment today, that’s because the investment keeps on getting so much bigger.\n\nDecember 30, 2014\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut we need to be brutally honest. Finding your purpose or embracing your vocation or whatever you want to call it is going to be easier for some kids than for others. If you’re lucky enough to graduate without a lot of debt, or your parents are supportive, psychologically as well as financially, you’ll have a lot more room to maneuver. The fact might shape your choice of where to go to college. Lower cost and/or less debt might be more important, may give you more options, than a shinier name—though it’s also true that net tuition can be cheaper (can be, not necessarily is) at a wealthier and more prestigious school.\n\nDecember 30, 2014\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 30, 2014\n\u001c120\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI will simply add one other thought, based on my observation of friends and students from across the economic spectrum. If you grow up with less, you are much better able to deal with having less. That is itself a kind of freedom.\n\nDecember 30, 2014\n\u001c120\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 11, 2015\n\u001c123\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best advice I ever got, the thing that saved me, at the age of twenty-two, from becoming a lawyer, was this: Don’t try to figure out what you want to do with the rest of your life. You’re going to be a very different person in two or three years, and that person will have his own ideas. All you can really figure out is what you want to do right now.\n\nDecember 30, 2014\n\u001c127\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyet another argument for trying to do what you really love—because the lousy parts are only bearable if you’re enduring them for the right reasons. Of course you’re going to have to compromise. But let it be a compromise, not a capitulation. Let there be something to compromise for .\n\nDecember 30, 2014\n\u001c128\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinally, inventing your life is not about slacking off. You’ll need to work as hard as always, at least while you’re getting established, but because you’ll be doing it with a sense of purpose, you’ll find it more fulfilling than you could ever have imagined.\n\nDecember 30, 2014\n\u001c128\n\u0011\n\u0011"},{"ty":"te","id":"i.100","spi":40997},{"ty":"te","id":"i.101","spi":41267},{"ty":"te","id":"i.102","spi":41305},{"ty":"te","id":"i.103","spi":41700},{"ty":"te","id":"i.104","spi":42024},{"ty":"te","id":"i.89","spi":38232},{"ty":"te","id":"i.90","spi":38557},{"ty":"te","id":"i.91","spi":38675},{"ty":"te","id":"i.92","spi":38860},{"ty":"te","id":"i.93","spi":39022},{"ty":"te","id":"i.94","spi":39110},{"ty":"te","id":"i.95","spi":39396},{"ty":"te","id":"i.96","spi":39589},{"ty":"te","id":"i.97","spi":39740},{"ty":"te","id":"i.98","spi":40294},{"ty":"te","id":"i.99","spi":40959},{"ty":"as","st":"paragraph","si":38223,"ei":38223,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":38224,"ei":38224,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":38225,"ei":38225,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":38227,"ei":38227,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty"