e drawing out the doubts they’ve worked\n\nDecember 31, 2014\n\u001c136\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTools are value-neutral. Revolutions in our tools—the kind that have been wrought by Facebook, Apple, Google, and so forth, the kind so many young people dream of making, as they work on their gadgets and apps—do not necessarily alter the structure of society, and certainly not necessarily for the better.\n\nDecember 31, 2014\n\u001c138\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c143\n\u0011\n\u0011\n\n\nPart 3. Schools\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIncreasingly, anything you learn is going to become obsolete within a decade,” says Larry Summers, the former secretary of the\n\nDecember 31, 2014\n\u001c149\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTreasury and president of Harvard. “The most important kind of learning is about how to learn.” Writing\n\nDecember 31, 2014\n\u001c149\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCarlyle Group, one of the world’s largest private equity firms, put it this way earlier this year at the World Economic Forum in Davos, Switzerland: “H \u003d MC. Humanities equals more cash.” Information is freely available everywhere now; the question is whether you know what to do with it.\n\nDecember 31, 2014\n\u001c151\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe humanities are what we have, in a secular society, instead of religion. They are compatible with religion, but they have also, in important ways, supplanted it. As traditional beliefs were broken down across the eighteenth and nineteenth centuries—by modern science, by the skeptical critique of the Enlightenment—the arts emerged as the place where educated people went to contemplate those questions of meaning and value and purpose. Now the truth was multiple and personal, not settled and dogmatic. Instead of looking in the Bible, you read Dostoevsky, or listened to Beethoven, or went to see an Ibsen play. Libraries,\n\nDecember 31, 2014\n\u001c152\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmuseums, and theaters became the new churches, places where you came to court the old emotions of catharsis, transcendence, redemption, and joy. The arrangement became known as aestheticism, the religion of art. “The priest departs,” said Whitman, “the divine literatus comes\n\nDecember 31, 2014\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere is a reason we avoid the truth, with our sociable lies and our psychological blocks: it is usually too hard to bear. “A book must be the axe,” said Kafka, “for the frozen sea within us.”\n\nDecember 31, 2014\n\u001c154\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe ultimate reason to read the classic authors, Mark Edmundson says, “is to see if they may know you better than you know yourself.” I heard from a psychiatrist who uses literature as a tool of practice (“where else does a person become\n\nDecember 31, 2014\n\u001c157\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 31, 2014\n\u001c157\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ce was a deeply depressed, inhibited, bitter, and unfulfilled person. I suggested that he read D. H. Lawrence, and in this case, a rare exception, he took me up on the offer—the challenge really—and for most of his treatment\n\nWhat if you could prescribe the right book? Or art? Thru tech? This.method.might be based on physician experience but mine would be like what genomica could be doing to medicine\n\nDecember 31, 2014\n\u001c157\n\u0011\n\u0011"},{"ty":"te","id":"i.105","spi":42323},{"ty":"te","id":"i.106","spi":42768},{"ty":"te","id":"i.107","spi":42980},{"ty":"te","id":"i.108","spi":43448},{"ty":"te","id":"i.109","spi":43794},{"ty":"te","id":"i.110","spi":43846},{"ty":"te","id":"i.111","sp