ake vividly present how different the world feels to each of us.” Art teaches empathy and cultivates the emotional intelligence; maybe it can make you a better person\n\nDecember 31, 2014\n\u001c159\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most successful tyranny,” said Allan Bloom, is “the one that removes the awareness of other possibilities.” The past gave rise to the present, but it is also different from the present. It shows us that things do not have to be the way that they are now. It provides us with a vantage point from which to see that our conventional wisdom is just conventional, not wisdom—that what we think is natural is merely cultural; temporal, not eternal; particular, not universal. It offers us an exit from the present. It tells us that things change: not only don’t they have to be the way they are, they will not be the way they are. The past, in other words, allows us to create the future. If you want to be a leader, if you want to find a new direction, then that is where you need to start.\n\nDecember 31, 2014\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEducate” means “lead forth.” A teacher’s job is to lead forth the powers that lie asleep within her students\n\nDecember 31, 2014\n\u001c169\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou can download all the data you want, but it won’t be any good to you unless you have the software to make use of it. That software, the\n\nDecember 31, 2014\n\u001c169\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cability to operate on information—to understand it, to synthesize it into new combinations, to discover and create with it—is what college is meant to “install.” But here the analogy breaks down, for unlike actual software, the installation isn’t quick and easy, and it certainly isn’t passive.\n\nHow to create this installation process in the future? For mooc kids?\n\nDecember 31, 2014\n\u001c169\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou learn them in classes that are small enough to allow for individual attention, supplemented by one-on-one instruction tailored to your own specific aptitudes and needs.\n\nDecember 31, 2014\n\u001c170\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe purpose of a seminar is to enable your professor to model and shape the mental skills she’s trying to instill. She conducts a discussion about the material, but she doesn’t simply let you talk. She keeps the conversation focused. She challenges assertions, poses follow-up questions, forces students to elaborate their one-word answers or clarify their vague ones. She draws out the timid and humbles (gently) the self-assured.\n\nDecember 31, 2014\n\u001c171\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSome of those questions should be ones she doesn’t know the answer to herself. Discussion in a seminar should be collaborative and open-ended, alive with serendipity and the energy of imminent discovery—a model, too, of how to think together . A student at Pomona praised his professors to me for granting students the “necessary illusion of discussing a book as a peer.” Yet it isn’t altogether an illusion. One of the rewards of being a professor is the chance to learn from fresh young minds as well as teach them\n\nDecember 31, 2014\n\u001c171\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCollege teaching, like any other kind, is a slow, painstaking, difficult process. (It is also, when properly done and adequately supported, an intensely gratifying one.) It is itself a complex craft that can’t be scaled or automated. You have to get to know your students as individuals—get to know their minds, I mean—and you have to believe completely, as a fellow student wrote about my own professor, Karl Kroeber, in each one’s absolute uniqueness. (It was Karl who said that a genuine teacher teaches students, not courses.)\n\nBut if we could scale it...\n\nDecember 31, 2014\n\u001c172\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy years in the classroom, as well as my conversations with young people about their college experience, have convinced me there are two things, above all, that students want from their professors. Not, as people commonly believe, to entertain them in class and hand out easy A’s. That’s what they retreat to, once they see that nothing better is on offer. What they really want is that their teachers challenge them and that they care about them. They don’t want fun and games; they want the real thing.\n\n1. I want my teacher to challenge me and 2. To care about me.\n\nDecember 31, 2014\n\u001c172\n\u0011\n\u0011"},{"ty":"te","id":"i.119","spi":46454},{"ty":"te","id":"i.120","spi":46761},{"ty":"te","id":"i.121","spi":47591},{"ty":"te","id":"i.122","spi":47739},{"ty":"te","id":"i.123","spi":47917},{"ty":"te","id":"i.124","spi":48322},{"ty":"te","id":"i.125","spi":48534},{"ty":"te","id":"i.126","spi":49005},{"ty":"te","id":"i.127","spi":49561},{"ty":"te","id":"i.128","spi":50160},{"ty":"as","st":"paragraph","si":46445,"ei":46445,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":46446,"ei":46446,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":46447,"ei":46447,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":46449,"ei":46449,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":46451,"ei":46451,"sm":{