alse,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":50669,"ei":50731,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":50732,"ei":50750,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":50758,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou do not talk to your students; you listen to them. You do not tell them what to do; you help them hear what they themselves are saying. You ask the kinds of questions that Lara Galinsky talks about as being important at times of decision—those “why” questions that help people connect with what they care about\n\nDecember 31, 2014\n\u001c173\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMost advisors just tell you what courses to take, a student at Brown remarked to me, but the best ones “help you to think in a different way about the choice.” As Harry R. Lewis suggests, a mentor looks for the questions behind the questions their advisees ask. “The most important job of the advisor,” he writes, “is to help students understand themselves, to face and take responsibility for their\n\nDecember 31, 2014\n\u001c173\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdecisions, and to support and to free them to make choices that are at odds with the expectations others have for them.” Students look to mentors—figures “more attuned to their rising hopes”—to give them what their parents won’t or can’t: the permission to go their own way and the reassurance that their path is valid\n\nMentors\n\nDecember 31, 2014\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstudents gravitate toward teachers with whom they have forged a connection. Learning is an emotional experience, and mentorship is rooted in the intimacy of intellectual exchange. Something important passes between you, something almost sacred. Socrates remarks that the bond between a teacher and a student lasts a lifetime, even once the two have parted company. And so indeed it is. Student follows student, and professors know that even those with whom they’re closest now will soon decline to names in an address book, then at last just distant memories. But the feelings\n\nDecember 31, 2014\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthat we have for the teachers or the students who have meant the most to us, like those for long-lost friends, can never go away. They are part of us, and the briefest thought revives them, and we know that in some heaven we will meet again\n\nDecember 31, 2014\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe teacher, that professional amateur,” said the critic Leslie Fiedler, “teaches not so much his subject as himself.” He provides a model, he went on, “of one in whom what seemed dead, mere print on the page, becomes living, a way of life.”\n\nDecember 31, 2014\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe profession’s whole incentive structure is biased against teaching, and the more prestigious the school, the stronger the bias is likely to be.\n\nCreate a platform.with a new incentive structure\n\nDecember 31, 2014\n\u001c176\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTeaching well takes time. Challenging your\n\nDecember 31, 2014\n\u001c178\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstudents takes time: you have to assign a lot of work, and you have to comment on it carefully. Caring about your students takes time: you need to be willing to talk to them, if only about their work, and often for a lot longer than seven minutes. Just learning how to run a class takes time: how to lead a discussion, how to ask a good question, how to deliver a lecture that is worth your students’ attention. The ten-thousand-hour rule applies here, too. But every minute spent on teaching is a minute that is not devoted to research. Good teaching isn’t simply undervalued; especially at elite universities, it is actively discouraged, because it’s seen as raising doubts about your seriousness as a scholar. “Winning the campus teaching award,” said Ernest Boyer, vice president of the Carnegie Foundation for the Advancement of Teaching, “is the kiss of death when it comes to tenure.”\n\nDecember 31, 2014\n\u001c178\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA 2005 survey of college freshmen found that less than one in six were “very satisfied” with the teaching they’d experienced. A survey of seniors found that more than a third reported being “frequently bored in class.”\n\nDecember 31, 2014\n\u001c180\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnly about 4 percent of\n\nDecember 31, 2014\n\u001c182\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstudents who start one actually finish it, but most of those are adult learners who already have degrees and are looking for enrichment or new skills—people, that is, who are capable of directing their own education.\n\nDecember 31, 2014\n\u001c182\n\u0011\n\u0011"},{"ty":"te","id":"i.12