"as","st":"text","si":54613,"ei":54637,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":54638,"ei":54656,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":54676,"ei":54893,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":54894,"ei":54912,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lukouUKQe4xNl6585zf/xFRbb0g"  nonce="lukouUKQe4xNl6585zf/xFRbb0g">DOCS_modelChunk = [{"ty":"is","ibi":54920,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 31, 2014\n\u001c184\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTeaching isn’t information transfer, and it isn’t entertainment, either. It’s about the kind of interchange and incitement that can only happen in a seminar—“seminar” being a fancy name for what every class already is from K–12. It is labor-intensive; it is face-to-face; it is one-at-a-time. We can try to do it on the cheap, but we will get exactly what we pay for.\n\nDecember 31, 2014\n\u001c185\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 31, 2014\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 31, 2014\n\u001c193\n\u0011\n\u0011\n\n\nPart 4. Society\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy friend had once received a D for the semester—she’d been running an A in the class—because she was coming off a waitressing shift and had to hand her final paper in an hour late. That may be an extreme example, but it’s one that is unthinkable at schools like Yale. There are due dates and attendance requirements at elite colleges, but no one takes them very seriously. Extensions are available for the asking; threats to deduct credit for missed classes are rarely, if ever, carried out. Kids at prestigious schools, in other words, receive an endless string of second chances.\n\nDecember 31, 2014\n\u001c209\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey have little opportunity for the kinds of contacts that I saw my students get routinely—classes with visiting power brokers, dinners with foreign dignitaries. There are also few, if any, of the sorts of special funds that prestigious schools dispense in such profusion: travel stipends, research fellowships, performance grants. Each year, my old department gives out literally dozens of cash prizes for everything from senior theses down to freshman essays. In 2009, those prizes came to well over one hundred thousand dollars—in one department alone\n\nDecember 31, 2014\n\u001c209\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStudents at places like Cleveland State—and I’ve confirmed these observations with people who have worked at comparable schools—are being trained to occupy positions somewhere in the middle of the class system, in the depths of one bureaucracy or other. They’re being conditioned for lives with few second chances, no extensions, little support, narrow opportunity—lives of subordination, supervision, and control, lives of deadlines, not guidelines. For students at prestigious schools, it is exactly the reverse: connections, freebies, privileges, access. And one more thing: impunity.\n\nDecember 31, 2014\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI used to think that we needed to create a world where every child had an equal chance to get to the Ivy League. I’ve come to see that what we really need is to create one where you don’t have to go to the Ivy League, or any private college, to get a first-rate education.\n\nIgs...\n\nDecember 31, 2014\n\u001c227\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe beggarly question of parentage—what is it, after all? What does it matter, when you come to think about it, whether a child is yours by blood or not? All the little ones of our time are collectively the children of us adults of the time, and entitled to our general care.\n\nDecember 31, 2014\n\u001c232\n\u0011\n\u0011"}
}'


